/*SPDX-License-Identifier: UNLICENSED*/
pragma solidity >=0.4.22 <0.9.0;

contract GridFactory {
  address[] public allGrids;
  mapping(address => address[]) public deployedGrids; //Manager to grid

  function createGrid(string memory _gridName, string memory _country, uint _capacity, string memory _state) public returns (address) {
    address newGrid = address(new Grid(msg.sender, _gridName, _country, _capacity, _state));
    deployedGrids[msg.sender].push(newGrid);
    allGrids.push(newGrid);
    return newGrid;
  }

  function getAllGrids() public view returns (address[] memory) {
    return allGrids;
  }

  function getMyDeployedGrid() public view returns (address[] memory) {
    return deployedGrids[msg.sender];
  }
}

contract Grid {
  string gridName;
  string state;
  string country;
  uint public capacity;
  address public manager;

 constructor(address creator, string memory gridName_, string memory country_, uint capacity_, string memory state_) {
    manager = creator;
    state = state_;
    country = country_;
    capacity = capacity_;
    gridName = gridName_;
  }

  function getGridName() public view returns(string memory) {
    return gridName;
  }

  function getState() public view returns(string memory) {
    return state;
  }

  function getCountry() public view returns(string memory) {
    return country;
  }

  function getCapacity() public view returns(uint) {
    return capacity;
  }

  modifier isManager() {
    require(msg.sender == manager, "Not authorized.");

    _;
  }

  function changeManager() public isManager {
    manager = msg.sender;
  }
}
